1) Concrete strategies refers to (but not limited to): 
- Prevention: i) engagement with Armed Forces/Groups ii) development of Action Plans to prevent recruitment and use of children in armed conflict;
- Report: i) establishment of networks ii) specific coordination mechanisms;
- Response: i) development of Action Plans for release ii) identification of CAAFAG and children in detention and/or deprived of liberty and iii) community reintegration. 

NB. Number of children released can be reported under indicator PRO-I15
